    onBus_Reg_T51DocumentChange: function(filefield, value, eOpts) {
        //var objSubmissionNo = Ext.ComponentQuery.query('#hdnSubmissionNo')[0].getValue();
        Ext.getCmp('Bus_Reg_T51DocumentForm').getForm().submit({
            url: '../Handlers/Common/DocumentUploadHandler.ashx',
            // params:{submissionNo:objSubmissionNo},
            waitMsg: 'Uploading your document...',
            success: function(form,action) {

                if(action.result.success!=true)
                {
                    msg("FAILURE","Document Upload Failed");
                    return;
                }
                console.log('action',action);
                var arr=action.result.msg.split("*");
                Ext.ComponentQuery.query('#Bus_Reg_T51DocumentTxt')[0].fullName=action.result.msg; 
                Ext.ComponentQuery.query('#Bus_Reg_T51DocumentTxt')[0].setValue(arr[1]);

            },
            failure: function(form,action) {

                msg("FAILURE","Document Upload Failed");
            }
        });


    },

